public class GoodMemories {

    public static void main(String[] args) {
        /* Enter your code here. Read input from STDIN. Print output to STDOUT. Your class should be named Solution. */
        Scanner in = new Scanner(System.in);
        int numQ = in.nextInt();
        in.nextLine();

        for (int i = 0; i < numQ; i++) {
            int numE = in.nextInt();
            in.nextLine();
            List<List<String>> es = new ArrayList<List<String>>();
            for (int j = 0; j < numE; j++) {
                String aLine = in.nextLine();
                List<String> sp = new ArrayList<String>();
                String[] strs = aLine.split(",");
                sp.addAll(Arrays.asList(strs));
                es.add(sp);
            }
            process(es);

        }
        in.close();
    }

    //using adjacency list to reflect "direction of element", suppose two elements do not link bidirectional
    static void process(List<List<String>> es) {

        // System.out.println(places);
        Map<String, Set<String>> orders = new HashMap<String, Set<String>>();
        for (List<String> l : es) {
            for (int i = 0; i < l.size() - 1; i++) {
                for (int j = i + 1; j < l.size(); j++) {
                    if (orders.containsKey(l.get(i))) {
                        orders.get(l.get(i)).add(l.get(j));
                    } else {
                        Set<String> tmpSet = new HashSet<String>();
                        tmpSet.add(l.get(j));
                        orders.put(l.get(i), tmpSet);
                    }
                    if (orders.get(l.get(j)) != null
                            &&
                            orders.get(l.get(j)).contains(l.get(i))
                            ) {
                        System.out.println("ORDER VIOLATION");
                        return;
                    }
                }

            }
            //System.out.println(orders);
        }
        System.out.println("ORDER EXISTS");

    }
}
